svg.script:
var sAmericaNations;

function Init()
  {
	sAmericaNations = new Array();
	// 0:ISO country code, 1:name, 2:population, 3:1000xinternet users (07/08), 4:1000xinternet users (00),
	// 5:area (sq km), 6: total GDP (10^10), 7:mobiles (thousands), 8: science papers (SCImago), 9: independence (year)
	// 10: coastline (km)
	sAmericaNations.push(["ar","Argentina",38747000,16000,2500,2766890,51.533,40402,64630,1816,4989]);
	sAmericaNations.push(["bo","Bolivia",9182000,580,120,1098580,3.6728,3254,1338,1825,0]);
	sAmericaNations.push(["br","Brazil",187316000,50000,5000,8511965,181.6965,151900,197705,1822,7491]);
	sAmericaNations.push(["cl","Chile",16295000,7387,1758,756950,22.65,15768,31137,1810,6435]);
	sAmericaNations.push(["co","Colombia",44556990,13745.6,878,1138910,29.85318,29763,11238,1810,3208]);
	sAmericaNations.push(["ec","Ecuador",14228000,1109.967,180,283560,10.244,10086,2028,1822,2237]);
	sAmericaNations.push(["gf","French Guiana",187000,42,2,91000,0.1122,138.2,367,"null",378]);
	sAmericaNations.push(["gy","Guyana",751000,190,3,214970,0.28538,281.4,214,1966,459]);
	sAmericaNations.push(["py","Paraguay",6158000,260,20,406750,2.7711,4330,404,1811,0]);
	sAmericaNations.push(["pe","Peru",27968000,7636.4,2504,1285220,21.581,19000,3710,1821,2414]);
	sAmericaNations.push(["sr","Suriname",499000,44,11.7,163270,0.38922,320,102,1975,386]);
	sAmericaNations.push(["uy","Uruguay",3463000,1100,370,176220,4.017,3004,4763,1825,660]);
	sAmericaNations.push(["ve","Venezuela",26749000,5940.426,950.4,912050,32.63,27400,15416,1811,2800]);

	var colorDex = -1;
	var divisor = -1;
	var URLvars = document.URL.split("?")[1].split("&");
	var dataRequest, comparisonType, comparisonValue, cColor;
	var requestType = -1;
	for(v=0; v<URLvars.length; v++){
		if(URLvars[v].indexOf("q=") == 0){
			dataRequest = URLvars[v].substring(2).toLowerCase();
			requestType = 1;
		}
		else if(URLvars[v].indexOf("c=") == 0){
			dataRequest = URLvars[v].substring(2).toLowerCase();
			requestType = 2;
		}
		else if(URLvars[v].indexOf("cType=") == 0){
			comparisonType = URLvars[v].substring(6).toLowerCase();
		}
		else if(URLvars[v].indexOf("cValue=") == 0){
			comparisonValue = URLvars[v].substring(7).toLowerCase();
		}
		else if(URLvars[v].indexOf("cColor=") == 0){
			cColor = "#" + URLvars[v].substring(7);
		}
	}
	switch(dataRequest){
		case "population":
			colorDex = 2;
			break;
		case "internets":
			colorDex = 3;
			break;
		case "internets-capita":
			colorDex = 3;
			divisor = 2;
			break;
		case "internets-2000":
			colorDex = 4;
			break;
		case "internets-2000-capita":
			colorDex = 4;
			divisor = 2;
			break;
		case "area":
			colorDex = 5;
			break;
		case "density":
			colorDex = 2;
			divisor = 5;
			break;
		case "gdp":
			colorDex = 6;
			break;
		case "gdp-capita":
			colorDex = 6;
			divisor = 2;
			break;
		case "mobiles":
			colorDex = 7;
			break;
		case "mobiles-capita":
			colorDex = 7;
			divisor = 2;
			break;
		case "mobiles-density":
			colorDex = 7;
			divisor = 5;
			break;
		case "science":
			colorDex = 8;
			break;
		case "science-capita":
			colorDex = 8;
			divisor = 2;
			break;
		case "independence":
			colorDex = 9;
			break;
		case "name":
			colorDex = 1;
			divisor = "null";
			break;
		case "coastline":
			colorDex = 10;
			break;
		case "coastline-density":
			colorDex = 10;
			divisor = 5;
			break;
	}
if((requestType == 2)&&(comparisonType)&&(comparisonValue)){
	var selectFunction;
	switch(comparisonType){
		case "lesser":
			selectFunction = function(a,b){ return (a<b); };
			break;
		case "greater":
			selectFunction = function(a,b){ return (a>b); };
			break;
		case "equal":
			selectFunction = function(a,b){ return (a==b); };
			break;
	}
	try{
	for(j=0; j<sAmericaNations.length; j++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = sAmericaNations[j][divisor]; }
		var stateCode = sAmericaNations[j][0];
		var labelColor = cColor;
		var altColor = "#999999";
		if(selectFunction( (sAmericaNations[j][colorDex]/divideOp), comparisonValue )){
			document.getElementById(stateCode).setAttribute('fill',labelColor);
		}
		else{
			if((divisor == "null")&&(selectFunction(sAmericaNations[j][colorDex].toLowerCase(), unescape(comparisonValue) ))){
				document.getElementById(stateCode).setAttribute('fill',labelColor);
			}
			else{
				document.getElementById(stateCode).setAttribute('fill',altColor);
			}
		}
	}
	}catch(e){ }
}
if((requestType == 1)&&(colorDex != -1)){	// find minimum and maximum values
	var minVal = null;
	var maxVal = null;
	var divideOp;
	for(i=0; i<sAmericaNations.length; i++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = sAmericaNations[i][divisor]; }
		var thisVal = sAmericaNations[i][colorDex] / divideOp;
		if (minVal == null || minVal > thisVal){ minVal = thisVal; }
		if (maxVal == null || maxVal < thisVal){ maxVal = thisVal; }
	}
	minVal -= 0.005 * (maxVal - minVal);
	maxVal += 0.15 * (maxVal - minVal);
	// color map
	var colorScale =  256 / (maxVal - minVal);
	var stateCode;
	try{
	for(j=0; j<sAmericaNations.length; j++){
		if(divisor == -1){ divideOp = 1; }
		else{ divideOp = sAmericaNations[j][divisor]; }
		stateCode = sAmericaNations[j][0];
		var labelColor = 256 - Math.floor(colorScale * ((sAmericaNations[j][colorDex]/divideOp) - minVal));
		var blueScale = 16 + Math.floor(0.1 * labelColor);
		var redScale = 55 + Math.floor(0.4 * labelColor);
		blueScale = (blueScale-0).toString(16);
		redScale = (redScale-0).toString(16);
		if(labelColor <= 15.5){
			labelColor = (labelColor-0).toString(16);
			document.getElementById(stateCode).setAttribute('fill','#' + redScale + '0' + labelColor + '' + blueScale);
		}
		else{
			labelColor = (labelColor-0).toString(16);
			document.getElementById(stateCode).setAttribute('fill','#' + redScale + '' + labelColor + '' + blueScale);
		}
	}
	}catch(e){  alert(stateCode); }
  }
}
